import {Link} from "react-scroll";

export default function Btn({textBtn, to, id, icon}) {
    //state

    //comportement

    return (
        <Link to={to} id={id} smooth={"easeInOutCubic"} duration={1000} offset={-88}>
            <button className="btnPortfolio">
                {textBtn}
                {icon}
            </button>
        </Link>
    )
}
